import React, { Component } from 'react';
import ReactTable from 'react-table';
import 'react-table/react-table.css';
import { Link } from 'react-router-dom';
import './admintecherrecord.css';
import Navbar from '../SideNavMenu';


class AdminTeacher extends Component {
    constructor(props) {
        super(props);

        this.state = {
            teachers: []
        }
    }

    componentDidMount() {
      
        return (

            <div>

                <Navbar />
                <div style={{paddingTop:'40px',paddingLeft:'60px',paddingRight:'20px'}}>
                <div class='row '>
                    <div class='col-xl-8'>
                        <p class='col-xl-11 col-l-12 text' >Teacher Records</p>
                    </div>

                    <div class='col-l-4 n'>
                        <Link to="/adminaddteacher"> <button class='btn btn-primary'>Add Teacher</button></Link>
                    </div>
                </div></div>
               
                <div class='col-l-12 reacttable'>
                    <ReactTable
                        columns={columns}
                        data={this.state.teachers}
                        filterable
                        defaultPageSize={10}
                        noDataText={'Please Wait'}
                    >


                    </ReactTable>

                </div>

            </div>
        )
    }
}

export default AdminTeacher;
